    [],nt"revision_timestamp": "2015-04-30T15:29:14.794169",nt"name": "summary-of-2002-waterfowl-production",nt"isopen":
    false,nt"url": null,nt"notes": "This is the sixth consecutive year of intensive
    monitoring of waterfowl nesting and production at Patuxent Research Refuge. Water
    levels during nesting and brood rearing have been on a roller coaster since 1998.
    1998 and 1999 were record drought years. 2000 and 2001 had normal water levels at
    the beginning of the nesting season and through the brood rearing season. 2002 had
    the driest winter on record and no snow fall. However, early spring rains did bring
    most of the water areas back to full pool. The lowest number of nest starts of all
    species since these intensive surveys began in 1997 occurred this year.",nt"license_title":
